@Toni_blackout @SusDenMucho No, sí la mojigata de Carmena tb lo hacía aquí, y lo siguen haciendo ahora los miserables de la derecha, como no.
Abandono de los barrios periféricos. Eso si, los barrios pijos limpitos, llenos de árboles, aceras anchas, ni un socavón en el suelo.
Con todo, aquí es + horroroso.

@lt4agreements We had a blackout last night -- car v. pole. The pole won.
I was in bed at 8:30, asleep by 9pm. 

Sorry about the accident victim, but that was the best sleep I've had in 4 years.
